import React, {useState, useEffect} from 'react';
import ReactDOM from 'react-dom';
import './index.css';


function App() {
  const [val1, setVal1] = useState("defaultVal1");
  const [val2, setVal2] = useState("defaultVal2");
  useEffect(function () {
    console.log(val1);
  },{val1});


  return (
      <div>

        <div><input type="text" onChange={(e)=>setVal1(e.target.value)} value={val1}/></div>
        <br/>
        <div><input type="text" onChange={(e)=>setVal2(e.target.value)} value={val2}/></div>
      </div>
  );
}

ReactDOM.render(
    <App/>,
    document.getElementById('root')
);
